  input: '"TEXT","F3A","C00265298","This amendment is in response to your letter stating
    a concern with the Year-End Report (7/1/01-12/31/01) filed by the Terry Everett
    for Congress Committee. In your letter dated May 7, 2002, your report indicates
    that Line 10 of the Summary Page discloses $329,423.00 in outstanding obligations.  Please
    find all Schedule Cs attached supporting that line.  Please also find that all
    outstanding loans are reported indicated their current status.  The committee
    has changed the Schedule C and Schedule C-1 for the loan from BankSouth in the
    amount of $100,000.00 to support the loan agreement of 3.650%. Please also note
    that Schedule A now itemizes spouses individually.  The committee has taken the
    necessary steps so this will not happen in the future.  If you have any further
    questions please let us know."'
